import React, { Component } from "react";

import { Menu, Icon } from 'antd';

const { SubMenu } = Menu;

class AppSidebar extends React.Component {
  handleClick = e => {
    console.log('click ', e);
  };

  render() {
    return (
      <Menu
        onClick={this.handleClick}
        style={{ width: 256 , height: '100vh'}}
        defaultSelectedKeys={['1']}
        defaultOpenKeys={['sub1']}
        mode="inline"
      >
          <Menu.Item key="1"><Icon type="file" />All file</Menu.Item>
          <Menu.Item key="2"><Icon type="carry-out" /> Recent</Menu.Item>
          <Menu.Item key="3"><Icon type="heart" /> Favor</Menu.Item>
          <Menu.Item key="4"><Icon type="user" />Created</Menu.Item>
          <Menu.Item key="5"><Icon type="usergroup-delete" />Joined</Menu.Item>
      </Menu>
    );
  }
}

export default AppSidebar
